import React, { Component } from 'react';
import './App.css';
import List from './list.js'

class App extends Component {
  constructor(props, context) {
    super(props, context);
    this.state = { todos:["start"] }
    this.add = this.add(this);
  } 
  add(e){
    e.preventDefault();
    alert("works");
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>
           To-Do-List
          </p>
        </header>
        <input className= "addTodo" id="text" type="text" name="addTodo" placeholder="" ></input>
        <input className= "addTodo"id="form-submit" type="submit" value="Add" onClick={add} ></input>
        <List todos={this.state.todos}>
        </List>
      </div>
    );
  }
}

export default App;
